import React from "react";
import { NavLink } from "react-router-dom";

const Books = () => {
	return (
		<>
			<div className="mt-5"></div>
			<NavLink class="mt-3 btn btn-primary" to="/addbook" role="button">
				Add Book
			</NavLink>
		</>
	);
};

export default Books;
